// WorkoutDetails.tsx
import { Button, Container, Typography } from '@mui/material';
import React from 'react';
import { useNavigate, useParams } from 'react-router-dom';

interface WorkoutDetailsProps {
  // Other props...
}

const WorkoutDetails: React.FC<WorkoutDetailsProps> = () => {
  const { workoutName } = useParams();
  const navigate = useNavigate();

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <Typography variant="h4" color="primary" gutterBottom>
        Workout Details
      </Typography>

      <Typography variant="h5" color="white" paragraph>
        Details for {workoutName}
      </Typography>

      {/* Include additional details or content for the workout as needed */}

      <Button
        variant="contained"
        size="large"
        color="primary"
        onClick={() => navigate('/')}
      >
        Back to Workouts
      </Button>
    </Container>
  );
};

export default WorkoutDetails;
